import React from 'react';
import {read_cookie} from 'sfcookies'

import NotFound from '../pages/404'

async function check() {
    const cookie = read_cookie('jwt')
    console.log(cookie.length)
    if (cookie.length === 0) return <NotFound/>
}

check()

const Home = () => {
    return (
        <div>
            Welcome To Home
        </div>
    );
};


export default Home;
